import about from "./about"
import work from "./projects"


function App() {


  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path="/" exact component={main}></Route>
          <Route path="/about" component={about}></Route>
          <Route path="/work" component={work}></Route>
          <Route path="*" component={elemental} />
        </Switch>
      </Router>

    </div>
  );
}

export default App;
